import React, { useState, useEffect } from 'react';
import { navigate, Link } from '@reach/router';
import axios from 'axios'

const OnePet = (props) => {
    const [prodInfo, setProdInfo] = useState({})

    useEffect(()=>{
        axios.get(`http://localhost:8000/api/products/${props.prodId}`)
        .then(res => {
            console.log('************')
            console.log(res)
            console.log('************')
            setProdInfo(res.data.results)
        })
        .catch(err=> console.log (err))

    }, []);

    const deleteProd = (e, id) =>{
        console.log('delete product number = ', id)
        axios.delete(`http://localhost:8000/api/products/delete/${props.prodId}`)
            .then(res => {
                console.log('*******DELETED*****')
                console.log(res)
                navigate("/")

            })
            .catch(err=> console.log (err))
    }







    return (
        <div>
            <div className="container">
                <br /><br />
                <Link to="/">Back to Home</Link>
                <br />
                <h3>Details About: PETNAMEHERE</h3>
                <br/>
                <div className="col-4 mx-auto">

                    <div className="card">
                        <div className="card-body">
                            <p>Pet type:</p>
                            <p>Description:</p>
                            <p>Skills:</p>
                            <p>SKILLA</p>
                            <p>SKILLB</p>
                            <p>SKILLC</p>
                        </div>
                    </div>

                </div>
            </div>
        </div>
    );
};

export default OnePet;
